import React from 'react';
import { useParams } from 'react-router-dom'
const ProjectPage = () => {
    const { projectId } = useParams();


    return (
    <div className='background center'>
        <div className='line'>
        <h1>{projectId}</h1>
        </div>
    </div>
    );
}

export default ProjectPage;
